docs/个人阶段性总结/20200930.html.body:
2020年9月7日 - 2020年9月30日



重要工作

完成入职
2020年9月7日, 我正式入职导远科技有限公司, 开始为期半年的入职培训期;


了解公司基本概况
根据新员工入职手册, 向公司前辈了解公司概况及公司的主要产品;


阅读公司的VG算法
目标是弄懂VG算法, 然后配合胡松一起完成算法的移植;


前往北京办公司
2020年9月21日, 我跟随李博前往北京分公司, 向胡松学习各种嵌入式的入门知识;


编写Matlab脚本测试VG算法
根据自己对VG算法的了解并依据源文件在Matlab上编写VG算法, 并使用胡松给的数据进行离线仿真;


使用C语言在自己的电脑上编写VG算法(即将完成)
在把算法移植到芯片前, 先在自己的电脑上编写一次VG算法, 使用gcc编译, 完成头文件及头文件的编写, gdb调试好后利用离线数据测试算法, 对比Matlab的效果, 如并无很大差别则开始正式移植; 因为头文件及源文件已经编写好, 可以直接搬到芯片上面, 再看XC32是否能成功编译;　　




重要收获

对IMU有了进一步认识
了解了IMU的基本原理, 明白了陀螺表与加速度计读数的物理意义, 为后面使用卡尔曼滤波打下基础;


了解及开始使用C
通过阅读VG算法及AG47项目芯片上的代码, 对C有了更好的认识, 并开始使用C重现公司的VG算法:  
使用了cmake对C代码进行库的生成与链接, 配合编译器生成了一段VG算法的可执行文件;
在VSCode上配置好了GDB, 对自己初步编写的VG算法进行了调试;




了解嵌入式知识
通过跟胡松学习, 初步了解了嵌入式编程方面的一些知识, 有了以后嵌入式学习的方向, 并使用PICkit进行了在电脑上对芯片进行了调试, 然后使用串口工具读取了芯片的串口输出.




重要计划

完成VG算法的移植
将VG算法移植到SAME51A18芯片上面, 对算法的效果进行评估, 并根据效果调整算法中的各种参数;


继续学习嵌入式知识
要对各种数据的输入输出协议有更深的了解;
要了解微机一些重要部分的工作方法；
要了解芯片和外设上面一些重要的寄存器的工作方法;
要把Microchip公司的SAM D5x&E5x Family Data Sheet.pdf 手册读个大概, 通过手册和手上的芯片学习嵌入式知识;


继续学习C
要学习C关于内存管理方面的知识, 有机会的话也要了解C的线程操作;


继续学习状态估计方面知识
要好好学习卡尔曼滤波, 了解他的变种, 至少要做能自己推一次扩展卡尔曼滤波;


继续学习关于刚体运动的知识
要把四元数(Hamilton), 欧拉角, 旋转向量这三种IMU常用的物理量弄透彻;
